import logo from './logo.svg';
import './App.css';
import React,{ Component } from 'react';
import SignUp from './Components/SignUp';
import { Route, Routes } from 'react-router-dom';
import { NoMtach } from './Components/NoMatch';
import { Navbar } from './Components/Navbar';
import { Home } from './Components/Home';
import { Cart } from './Components/Cart';
import { Profile } from './Components/Profile';
import Profile2 from './Components/Profile2';
import CheckLogIn from './Components/CheckLogIn';
import NotLoggedUser from './Components/NotLoggedUser';


class App extends Component{
  render() {
    return (
      <>
        {/* <SignUp /> */}
        <Navbar/>

        <Routes>
          <Route path='/' element={<Home/>} />
          <Route path='/cart' element={<CheckLogIn render={(isLoggedIn)=> isLoggedIn ? <Cart/>:<NotLoggedUser/>}/>} />
          <Route path='/profile' element={<CheckLogIn render={(isLoggedIn)=> isLoggedIn ? <Profile/>:<NotLoggedUser/>}/>} />
          <Route path='/login' element={<SignUp/>} />
          <Route path='*' element={<NoMtach/>}/>
        </Routes>
      </>
    )
  }
}

export default App;
